description:
La conception de la fente de protection empêche les yeux d’être brûlés;
 Boucle durable, sans blesser les cils et les paupières, stéréotypes rapides et durables;
 Opération Simple, chauffage rapide, bouclage à 360 degrés dans toutes les directions;
 Le produit s’éteint automatiquement en 5 minutes et passe en mode de protection intelligent.
Taille du produit : 138*26*26mm
Tension de fonctionnement : 3,7 V
Batterie  : 380 mAh
Temperature range: 65℃/85℃
Matériau du produit : fil chauffant, PC, ABS, acrylique
